import React from 'react';
import './Navbar.css';

const Navbar = props => {
    return (


        <nav className="nav-wrapper blue lighten-1 Nav">
            <a href="#!" className="brand-logo center">{props.title}</a>
            <a href="#" data-target="mobile-demo" className=" right"><i className="material-icons">menu</i></a>

            <ul className="sidenav" id="mobile-demo">
                <h3 className="center" id="Menu">Menu</h3>
                <hr></hr>
                <li><a href="#" className="">Account Settings</a></li>
                <li><a href="#">Logout</a></li>
            </ul>
        </nav>


    )
}

export default Navbar;
